import React from 'react';
import { Link } from 'react-router-dom';

import { Button, BtnTypes } from '../components';

import './ProductionPage.css';

export const ProductionPage = () => {

	return (
    <section>
      <h1>PRODUCTION PAGE</h1>

      <Link to="/"><Button text={'Назад'} type={BtnTypes.warn}/></Link>
      <Link to="/"><Button text={'Управление'} type={BtnTypes.primary}/></Link>
    </section>
  );
}
